import { Level } from "../Level";
import { EmptyMahjong } from "../mahjongs/Mahjong";

export class TestLevel extends Level {
    id =1;
    difficulty = 1;
    board = [
        [
            [new EmptyMahjong(), new EmptyMahjong(), new EmptyMahjong()],
            [new EmptyMahjong(), new EmptyMahjong(), new EmptyMahjong()],
            [new EmptyMahjong(), new EmptyMahjong(), new EmptyMahjong()],
        ]
    ];
    background = "test";
}
